import React from 'react';
import styled from 'styled-components';

const Container = styled.main`
  background-color: #0C222F;
`;

const Section = styled.section`
  width: 1440px;
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
  text-align: center;
`;

const Title = styled.h1`
  color: white;
  font-family: 'Josefin Sans', sans-serif;
  font-size: 25px;
  font-weight: 400;
  line-height: 30px;
  letter-spacing: 0em;
  text-align: left;
  padding-left: 330px;
  margin-left: 100px;
`;

function Home() {
  return (
    <Container>
      <Section>
        <div className="container hero__container">
          <Title>
            Ласкаво просимо до нашого онлайн-магазину тютюну для кальяну!<br />
            У нас є широкий вибір смаків та марок, які задовольнять навіть найвибагливішого любителя кальяну.<br />
            Замовляйте прямо зараз і насолоджуйтесь вишуканим димом, створеним з найякіснішого тютюну.<br />
            Наші продукти гарантовано піднімуть настрій і додадуть неповторних відчуттів під час кальянної сесії.<br />
            Замовляйте вже сьогодні та насолоджуйтесь вишуканим досвідом кальянування разом з нами!
          </Title>
        </div>
      </Section>
    </Container>
  );
}

export default Home;
